import React, {Component} from 'react';

class Meal extends Component {
  constructor(props) {
    super(props);

  }
  render() {
    // const {label, image, yield, ingredientLines,}
    return(
      <article className="Meal">
        <h2 className="Meal__label">{this.props.label}</h2>

        image: {this.props.image}
      </article>
    );
  }
}

export default Meal;
